import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './Navbar.scss';
import logo from './grc-logo.svg';
import $ from 'jquery';

import { Link } from 'react-router-dom';


export default class GrcNavbar extends Component {
  componentDidMount () {
    $( "li" ).hover(
      function() {
          $(this).find("span").stop().animate({
          width:"100%",
          opacity:"1",
        }, 400, function () {
        })
      }, function() {
          $(this).find("span").stop().animate({
          width:"0%",
          opacity:"0",
        }, 400, function () {
        })
      }
    );
  }
  render() {
    return (
      <div>
        {/* Bouton Toggle Hamburger Icon */} 
        <div className="button_container" id="toggle">
          <span className="top" />
          <span claas="middle" />
          <span className="bottom" />
        </div>
        {/*FIn*/}
        {/*Menu */}
        <div className="overlay" id="overlay">
          <nav className="overlay-menu">
            <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/">About</a></li>
              <li><a href="/">Work</a></li>
              <li><a href="/">Contact</a></li>
            </ul>
          </nav>
        </div>
        {/* Fin */}
        <header />
      </div>
    )
  }
}
